import React, { Component } from 'react';
import {
  Table
} from "reactstrap";

export default class ModalRoom extends Component {



  generateTableRows = () => {
    const { histories } = this.props;

    let rows = (
      <tr>
        <td colSpan="6" className="table-warning text-center"><strong><em>Data Still Empty</em></strong></td>
      </tr>
    );

    if (histories.length > 0) {
      rows = histories.map((history, index) => {
        return (
          <tr key={index}>
            <td className="text-center">{index + 1}</td>
            <td className="text-center">{history.bidder.username}</td>
            <td className="text-center">{history.bidAmount}</td>
          </tr>
        )
      });
    }
    return rows;
  }

  render() {
    return (
      <div>
        <Table hover bordered striped responsive size="sm">
          <thead>
            <tr>
              <th className="text-center">No.</th>
              <th className="text-center">User</th>
              <th className="text-center">Bid Amount</th>
            </tr>
          </thead>
          <tbody>
            {this.generateTableRows()}
          </tbody>
        </Table>
      </div>
    )
  }
}
